import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <navigator>
          <span className="nav">Home</span>
          <span className="nav">Account</span>
          <span className="nav">Settings</span>
          <span className="nav">About</span>
        </navigator>
      </header>
    </div>
  );
}

export default App;
